import React from 'react';
import { DataGrid } from '@material-ui/data-grid';

const columns = [
  {
    field: "id",
    type: "number",
    headerName: "ID",
    width: 100,
    editable: false
  },
  {
    field: "title",
    headerName: "Name",
    type: "number",
    width: 250,
    editable: false
  },
  {
    field: "amount",
    type: "number",
    headerName: "Prize",
    width: 150,
    editable: false
  },
  {
    field: "currency",
    headerName: "Coin",
    width: 150,
    editable: false
  },
  {
    field: "tradeType",
    headerName: "Asta",
    type: "number",
    width: 150,
    editable: false
  }
];

  export default function App(data) {

      console.log(data)
      const rows = data.data.items.map((row) => {
        const { productId, ...rest } = row;
        return { id: productId, ...rest };
      });

      const [sortModel, setSortModel] = React.useState([
        {
          field: 'amount',
          sort: 'asc',
        },
      ]);

      if (data.data.error) {
        return <div>Error: {data.data.error.message}</div>;
      } else if (!data.data.isLoaded) {
        return <div>Loading...</div>;
      } else {
        return (
          <div style={{ height: 1000, width: "100%" }}>
            <DataGrid
              rows={rows}
              columns={columns}
              ortModel={sortModel}
              onSortModelChange={(model) => setSortModel(model)}
              id="productId"
              pageSize={100}
              density="compact"
            />
          </div>
        );
      }
  }
